// Sprting Functions for Low to high and High to low
function sortLH() {
  let items = JSON.parse(localStorage.getItem("items"));

  items = items.sort(function (a, b) {
    return a.price - b.price;
  });
  showItems(items);
}

function sortHL() {
  let items = JSON.parse(localStorage.getItem("items"));

  items = items.sort(function (a, b) {
    return b.price - a.price;
  });
  showItems(items);
}

